import React, { Children } from "react";
import InIcon from "../InCard/assets/bill-stack.png";



function Card2({children}) {
  return (
    <div>
    <div class="card">
        <img class="responsive-img" style={{width: 50 , marginLeft:20 ,marginTop:20 }} src={InIcon}></img>
        <h4>Money Outbox</h4>
        <div class="card-content">
            <div class="negative">{children}</div>
        </div>
    </div>    
</div>
  );
}

export default Card2;
